import React from 'react';
import { useEffect, useState } from "react";
import { Container } from "react-bootstrap";
var list;

const PopularDomains1 = () => (
  <ul>
    {list.map(item => (
      <li key={item.rank}>
        <div>{item.rank}</div>
        <div>{item.rankChange}</div>
        <div>{item.domain}</div>
        <div>{item.category}</div>
      </li>
    ))}
  </ul>
);

const PopularDomains = () => {
    const [content, setContent] = useState({});
    const [loading, setLoading] = useState(true);
    var labels,data,arrChart;
    const options = {
      responsive: true,
      plugins: {
        title: {
          display: true,
          text: 'Traffic Change',
        },
      },
    };
    useEffect(() => {
        console.log("useeffect called");
        fetch("https://workers.cnainani.workers.dev/popular-domains", { mode: "cors" })
        .then((response) => {
          console.log("response is:"+response);
          return response.json();
        })  
        .then((dataRes) => {
            list=dataRes.rankingEntries
            setContent(list);
            setLoading(false);
        });
      },[]);


    if (loading) {
      console.log("loading screen");
      return <Container>loading screen</Container>;
    }
    return (
      <Container>
    {list.map(item => (
      <li key={item.rank}>
        <tr>
        <td>{item.rank}</td>
        <td>{item.rankChange}</td>
        <td>{item.domain}</td>
        <td>{item.category}</td>
        </tr>
      </li>
    ))}
      </Container>
    );
  };


export default PopularDomains;
